import axios from "axios";

export const getStadiumList = (filterCondition) => {
    return axios.get("http://localhost:3000/api/stadium", { params: filterCondition });
};

export const getDefaultStadiumList = () => {
    return axios.get("http://localhost:3000/api/stadiums");
};

export const getDetailedStadiumInfo = (stadiumId) => {
    return axios.get(`http://localhost:3000/api/stadium/${stadiumId}`);
};
